      // This example requires the Visualization library. Include the libraries=visualization
      // parameter when you first load the API. For example:
      // <script src="https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&libraries=visualization">

      var map, heatmap;

      function initMap() {
        map = new google.maps.Map(document.getElementById('map'), {
          zoom: 13,
          center: {lat: 37.775, lng: -122.434},
          mapTypeId: 'terrain',
          gestureHandling: 'greedy',
        });

        var distances = [0, 60, 90, 120, 150, 180, 1000];
        var colors = [
             'rgba(0, 255, 0, 1)', // 60 bellow 1h is greeen
             'rgb(133, 244, 65)', // 90 is greenish
             'rgb(255, 161, 0)', // 120 is orange
             'rgba(244, 65, 65, 1)', // 150 is red
             //'rgba(244, 188, 66, 1)', // 90 bellow 1h30 is orange
             //'rgba(244, 65, 65, 1)', // 120 bellow 2h is red
             //'rgba(229, 65, 244, 1)', // 150 bellow 2h30 is pink
             'rgba(65, 67, 244, 1)', // 180 bellow 3h is blue
             'rgba(0, 0, 0, 1)', // +
       ];

        for(var d = distances.length - 1; d >= 1; d--) {
           $('#colors').prepend('<div id="d'+d+'" />');
           $('#d'+d).css({
               height:'30px',
               width:'100%',
               backgroundColor:colors[d-1]
           }).text('Between '+distances[d-1]+' and '+distances[d]+' minutes');
           heatmap = new google.maps.visualization.HeatmapLayer({
             data: getPoints(distances[d-1], distances[d]),
             map: map,
             gradient:[
                'rgba(255, 0, 0, 0)',
                colors[d-1],
                colors[d-1],
                colors[d-1],
                colors[d-1],
                colors[d-1],
                colors[d-1],
                colors[d-1],
                colors[d-1],
                colors[d-1],
              ],
              radius:7,
              opacity:0.7,
           });
        }
      }

      function getPoints(min, max) {
         var ret = [];
        var bounds = new google.maps.LatLngBounds ();
         for(var s in stations) {
            var p = new google.maps.LatLng(
                           stations[s].lat,
                           stations[s].lon
                        );
            if(stations[s].dur >= min && stations[s].dur < max)
               ret.push(p);
            bounds.extend(p);
         }
         map.fitBounds(bounds);
         return ret;
      }
    </script>
